
function loadJSON(url,callback){var xobj=new XMLHttpRequest();xobj.overrideMimeType("application/json");xobj.open('GET',url,true);xobj.onreadystatechange=function(){if(xobj.readyState==4&&xobj.status=="200"){callback(xobj.responseText);}};xobj.send(null);}
(function(){try{loadJSON("./config/client/index.config.json",function(response){var indexConfig=JSON.parse(response);var head=document.getElementsByTagName('head')[0];document.title=indexConfig.title;var favicon=document.createElement('link');favicon.rel=indexConfig.favicon.rel;favicon.type=indexConfig.favicon.type;favicon.href=indexConfig.favicon.href;head.appendChild(favicon);for(var i in indexConfig.cdn.css){var link=document.createElement('link');link.rel=indexConfig.cdn.css[i].rel;link.type=indexConfig.cdn.css[i].type;link.href=indexConfig.cdn.css[i].href;head.appendChild(link);}
for(var i in indexConfig.cdn.js){var link=document.createElement('link');link.type=indexConfig.cdn.js[i].type;link.href=indexConfig.cdn.js[i].href;head.appendChild(link);}});}catch(err){console.error(err);}})();(function(){try{loadJSON("./config/client/index.config.json",function(response){var indexConfig=JSON.parse(response);var head=document.getElementsByTagName('head')[0];var charset=document.createElement('meta');charset.charset=indexConfig.meta.charset;head.appendChild(charset);for(var i in indexConfig.meta.entries){var link=document.createElement('meta');link.name=indexConfig.meta.entries[i].name,link.content=indexConfig.meta.entries[i].content;head.appendChild(link);}});}catch(err){console.error(err);}})();